import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";
import Home from "../Component/Home";

const AllRoutes = () => {
  return (
    <BrowserRouter>
      <Switch>
        {/* <Route exact path="/register" element={<Register />} /> */}
        <Route exact path="/home" component={Home} />
      </Switch>
    </BrowserRouter>
  );
};

export default AllRoutes;
